import React, { Component } from 'react';
import ImageLayout from '../ImageLayout';
import "./LeftSide.css";
import covid from "../../../images/covid.png";
import groups from "../../../images/groups.png";
import memories from "../../../images/memories.png";

class LeftSide extends Component {
    constructor(props) {
        super(props);
        this.state={
            data:[]
        }
    }
    getData=()=>{
        let jsondata=[
            {
                "image":covid,
                "text":"Covid 19 information centre"
            },
            {
                "image":groups,
                "text":"Friends" 
            }
        ];
        this.setState({data:jsondata});

    }
    componentDidMount(){
        this.getData(); 
    }

    render() { 
        return (
            <div>
                {
                    this.state.data.map((item)=>{
                        <ImageLayout text={item.text}  image={item.image}/>
                    })
                }
                <ImageLayout text="aakash" image={covid}/>
                <ImageLayout text="brock lesnar" image={groups}/>
                <ImageLayout  text="aakash" image={memories}/>
                <ImageLayout text="aakash" image={covid}/>
                <ImageLayout text="aakash" image={groups}/>
                <ImageLayout text="aakash" image={memories}/>
                
            </div>
          );
    }
}
 
export default LeftSide;
